description:
G-Martin h&amp;auml;lsar:

&quot;Adde &amp;auml;r en underlig karakt&amp;auml;r. Jag var med vid hans f&amp;ouml;rsta fylla, och jag var med n&amp;auml;r han p&amp;aring;stod sig ha landat sin f&amp;ouml;rsta trekant. Killen m&amp;aring;r ofta skit, d&amp;auml;rf&amp;ouml;r tyckte jag att han har f&amp;ouml;rtj&amp;auml;nat en s&amp;aring;ng som denna.&quot;

Denna torrent inneh&amp;aring;ller &amp;auml;ven aldrig f&amp;ouml;rut sedda scener d&amp;auml;r G-Martin spelar fel och bjuder p&amp;aring; ett &quot;alternativt&quot; solo.
